import React from "react";
import { useNavigate } from "react-router-dom";

export const PrevPageBtn = ({ returnTitle, customStyle ,goToAddress }) => {
  const navigate = useNavigate();
  return (
    <>
      {goToAddress ? (
        <div
          className={`text-primary pointer ${customStyle}`}
          onClick={() => navigate(-1)}
        >
          {returnTitle}
        </div>
      ) : (
        <div
          className={`text-primary pointer ${customStyle}`}
          onClick={() => navigate(-1)}
        >
          {returnTitle}
        </div>
      )}
    </>
  );
};
